import React,{useState} from 'react';
import CabinSearchForm from '../../getCabins/CabinSearchForm';
import CabinTable from '../../getCabins/CabinTable';
export default function SearchCabins(){

    const [query, setQuery] = useState("");
    const [search, setSearch] = useState(false);
    return (
        <div>
            <h3>Search</h3>
            <CabinSearchForm setQuery={setQuery} setSearch={setSearch} />
            <CabinTable query={query} search={search} setSearch={setSearch} />
        </div>
    )
}
